import React from 'react';
// import logo from './logo.svg';
import './App.css';
import Test from './test';


import { Switch, Route } from "react-router-dom";

class App extends React.Component {
  render() {
    return (
      <Switch>
        <Route exact path={["/login", "/"]}>
          <Login />
        </Route>
        <Route exact path="/test">
          <Test />
        </Route>
      </Switch>
    );
  }
}

export default App;
